import React from 'react';
import './navbar.css';

function Navbar() {
  return (
    <div className="navbar">
      <a href="/product">Product</a>
      <a href="#about">About</a>
      <a href="#services">Services</a>
      <a href="#contact">Contact</a>
    </div>
  );
}

export default Navbar;
